import sys


class Solution(object):

	def shortestPalindrome(self, s):
		"""
		:type s: str
		:rtype: str
		"""

		if len(s) == 0:
			return s
		if len(s) == 1:
			return s

		maxLen = 0
		t = s[::-1]
		for i in range(1, len(s)+1):
			if s[:i] == t[-i:]:
				maxLen = i

		return t[:len(s)-maxLen]+s


